import ReactDOM from 'react-dom';
import React from 'react';

function ListOfMovies(){
    return (
    <ol>
     <li>Dark</li>
     <li>Independance day</li>
     <li>Fast & Furious</li>
     <li>Lap</li>
     <li>cap</li>
     <li>Random number is  {Math.random()} </li>
   </ol>

    );
}

export default ListOfMovies;
